{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/jarredpriester/data-visualization-to-communicate-our-climate?scriptVersionId=92411423\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"32338c3b","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.105304,"end_time":"2022-04-08T02:26:25.811246","exception":false,"start_time":"2022-04-08T02:26:25.705942","status":"completed"},"tags":[]},"source":["# Data Visualization to Communicate Our Climate\n","## Jarred Priester\n","## 1/21/22"]},{"cell_type":"markdown","id":"eba0c165","metadata":{"papermill":{"duration":0.104122,"end_time":"2022-04-08T02:26:26.020641","exception":false,"start_time":"2022-04-08T02:26:25.916519","status":"completed"},"tags":[]},"source":["1. Introduction\n","2. Downloading the data\n","3. Temperatures\n","4. Observed Carbon\n","5. Carbon Emissions\n","6. Greenhouse Gases\n","7. Summary\n","\n","# 1. Introduction\n","\n","Climate change is a difficult situation that we all face. Communicating our situation has also been difficult. As a data scientist I find that the best way to communicate difficult situations is through data. In this paper we will use data visualization to get a better understanding of our climate situation.\n","\n","We will be using data from the dslabs library in R. If you have not had a chance to explore the data sets from dslabs I recommend them, it is a fun and easy way to explore small data sets. The data we will be using is the following:\n","\n","***historic_co2***\n","\n","*Concentration of carbon dioxide in ppm by volume from direct measurements at Mauna Loa (1959-2018 CE) and indirect measurements from a series of Antarctic ice cores (approx.-800,000-2001 CE).*\n","\n","*Source: Mauna Loa data from NOAA. Ice core data from Bereiter et al. 2015 via NOAA.*\n","\n","***temp_carbon***\n","\n","*Annual mean global temperature anomaly on land, sea and combined, 1880-2018. Annual global carbon emissions, 1751-2014.*\n","\n","*Source: NOAA and Boden, T.A., G. Marland, and R.J. Andres (2017) via CDIAC*\n","\n","***greenhouse_gases***\n","\n","*Concentrations of the three main greenhouse gases carbon dioxide, methane and nitrous oxide. Measurements are from the Law Dome Ice Core in Antarctica. Selected measurements are providedevery 20 years from 1-2000 CE.*\n","\n","*Source: MacFarling Meure et al. 2006 via NOAA.*\n","\n","More on the dslabs data sets can me found [here](https://cran.r-project.org/web/packages/dslabs/dslabs.pdf)\n","\n","And more on NOAA, which stands for National Oceanic and Atmospheric Administration, where this data is from can be found [here](https://www.ncdc.noaa.gov/cag/global/time-series/globe/land_ocean/1/12/1880-2021?filter=true&filterType=loess)\n","\n","# 2. Downloading the data"]},{"cell_type":"code","execution_count":1,"id":"88c1d7e3","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-04-08T02:26:26.237586Z","iopub.status.busy":"2022-04-08T02:26:26.234687Z","iopub.status.idle":"2022-04-08T02:26:27.632781Z","shell.execute_reply":"2022-04-08T02:26:27.631414Z"},"papermill":{"duration":1.507304,"end_time":"2022-04-08T02:26:27.632939","exception":false,"start_time":"2022-04-08T02:26:26.125635","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: ‘scales’\n","\n","\n","The following object is masked from ‘package:purrr’:\n","\n","    discard\n","\n","\n","The following object is masked from ‘package:readr’:\n","\n","    col_factor\n","\n","\n"]}],"source":["# downloading libraries\n","library(tidyverse)\n","library(dslabs)\n","library(ggplot2)\n","library(ggthemes)\n","library(scales)\n","\n","#downloading the data\n","data(\"historic_co2\")\n","data(\"temp_carbon\")\n","data(\"greenhouse_gases\")"]},{"cell_type":"markdown","id":"f4e914b7","metadata":{"papermill":{"duration":0.110281,"end_time":"2022-04-08T02:26:27.85509","exception":false,"start_time":"2022-04-08T02:26:27.744809","status":"completed"},"tags":[]},"source":["# 3. Temperatures   \n","\n","Before we dive into the data visualizations let us take a quick look at the data we are working with for temperatures"]},{"cell_type":"code","execution_count":2,"id":"9fa483c5","metadata":{"execution":{"iopub.execute_input":"2022-04-08T02:26:28.113149Z","iopub.status.busy":"2022-04-08T02:26:28.080119Z","iopub.status.idle":"2022-04-08T02:26:28.181428Z","shell.execute_reply":"2022-04-08T02:26:28.180094Z"},"papermill":{"duration":0.215655,"end_time":"2022-04-08T02:26:28.181667","exception":false,"start_time":"2022-04-08T02:26:27.966012","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::af