xception":false,"start_time":"2022-04-08T02:26:30.733241","status":"completed"},"tags":[]},"source":["Above we can see that annual mean temperatures have been rising over the last century. The following is a quote from NASA explaining why that matters:\n","\n","*So, the Earth's average temperature has increased about 2 degrees Fahrenheit during the 20th century. What's the big deal?*\n","\n","*Two degrees may sound like a small amount, but it's an unusual event in our planet's recent history. Earth's climate record, preserved in tree rings, ice cores, and coral reefs, shows that the global average temperature is stable over long periods of time. Furthermore, small changes in temperature correspond to enormous changes in the environment.*\n","\n","*For example, at the end of the last ice age, when the Northeast United States was covered by more than 3,000 feet of ice, average temperatures were only 5 to 9 degrees cooler than today.*\n","\n","https://climate.nasa.gov/effects/\n","\n","## plot of land temperatures from 1880-2018"]},{"cell_type":"code","execution_count":4,"id":"fbdfe0f4","metadata":{"execution":{"iopub.execute_input":"2022-04-08T02:26:31.120484Z","iopub.status.busy":"2022-04-08T02:26:31.11804Z","iopub.status.idle":"2022-04-08T02:26:31.423631Z","shell.execute_reply":"2022-04-08T02:26:31.424163Z"},"papermill":{"duration":0.438864,"end_time":"2022-04-08T02:26:31.424333","exception":false,"start_time":"2022-04-08T02:26:30.985469","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`geom_smooth()` using method = 'loess' and formula 'y ~ x'\n","\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wU1doH8Ge29ySb3gOEGoqgSBELqGBv2AuC/dp7r+i1XisqeG0g9q4vKFhQ\nlAvSlV5DQgjpu9k222feP2Z3dnazCekJm9/3wx8zs2d2z24S8uQ55zyH2XqgjgAAAADg8Cfr\n6Q4AAAAAQOdAYAcAAACQIBDYAQAAACQIBHYAAAAACQKBHQAAAECCQGAHAAAAkCAQ2AEAAAAk\nCAR2AAAAAAkCgR0AAABAgkBgBwAAAJAgENgBAAAAJAgEdgAAAAAJAoEdA